e":"yo","languageName":{"simpleText":"Yoruba"}},{"languageCode":"zu","languageName":{"simpleText":"Zulu"}}],"defaultAudioTrackIndex":0}},"videoDetails":{"videoId":"WpN5PjOxHbo","title":"Does Body Language Prove Bob Lazar Actually Worked On Alien Spacecraft At Area 51?","lengthSeconds":"3829","keywords":["body language","bob lazar","robert lazar","annie jacobsen","joe rogan","zeda reticuli","aliens","ufo","area 51","s4","s-4","alien spacecraft","mib","independence day","george knapp","jeremy corbell","flying saucers","flying saucer","bob lazar: area 51 \u0026 flying saucers","body language of a liar","ufos","ufo sightings","groom lake","bob lazar 2019","powerfuljre","los alamos","joe rogan experience","element 115","men in black","pewdiepie","storming area 51","storm area 51"],"channelId":"UC65EDzqpOAQZLBmAdHAnZng","isOwnerViewing":false,"shortDescription":"Did Bob Lazar actually work on recovered alien spacecraft at Area 51 for the U.S. Government? Were going to analyze his body language to find out.\n\nBob Lazar claims to be a scientist who worked on alien spacecraft at Area 51 (S4) for the U.S. Government in the late 1980s.\n\nEspecially for this video, its important for you to know if I have any biases going into this. Ive never seen a UFO or aliens, but, like many, I believe were probably not completely alone in the universe. Prior to doing this analysis, havent heard of Bob Lazar and when I did, thought hes at least a little deceitful because his story is so extraordinary. \n\nWhats interesting is that over the past few years, the U.S. Government has become more open to admitting the existence of this UFO stuff. Interesting that the U.S. Government isnt completely ignoring these claims anymore.  Probably because when something odd is seen, it can now be easily recorded since cameras are everywhere, and once its recorded, the internet can spread it across the world in seconds.\n\nWhats interesting about all this is someones lying, its either the U.S. Government for totally hiding and covering all this up or its Bob Lazar. So were going to put our neutral hats on to analyze Bob Lazars body language, piece together his story, and review the evidence to find out if he is truthful or just lying.\n\nNow in the comments, why do you think the U.S. Government seems to be trying to hide all this from us? Let everyone know in the comments below.\n\nGive this video a THUMBS UP if you think were NOT ALONE in the universe.\n\nGive this video a THUMBS DOWN if you think were COMPLETELY ALL ALONE in the universe.\n\nRemember to subscribe so you dont miss out on new body language and investigative videos where we always seem to shake up YouTube, and Ill see you at the top.\n\n#BobLazar #Area51 #BodyLanguage\n\nMy Vlog Channel:\nhttps://www.youtube.com/channel/UCGof-YmYH1e-Hu9tmH39_rw\n\nFollow me and also send me your future video ideas via social media:\nInstagram:\nhttps://www.instagram.com/derekvanschaik\n\nTwitter:\nhttps://www.twitter.com/derekvanschaik\n\nFacebook:\nhttps://www.facebook.com/derekmvanschaik\n\nWebsite:\nhttps://www.derekvanschaik.com","isCrawlable":true,"thumbnail":{"thumbnails":[{"url":"https://i.ytimg.com/vi/WpN5PjOxHbo/hqdefault.jpg?sqp=-oaymwEiCKgBEF5IWvKriqkDFQgBFQAAAAAYASUAAMhCPQCAokN4AQ==\u0026rs=AOn4CLC0mmizphnEsHV2Wy0J__Ug3ZSobg","width":168,"height":94},{"url":"https://i.ytimg.com/vi/WpN5PjOxHbo/hqdefault.jpg?sqp=-oaymwEiCMQBEG5IWvKriqkDFQgBFQAAAAAYASUAAMhCPQCAokN4AQ==\u0026rs=AOn4CLCqotcT-juLMaNe8GiUyXJdCmSQhQ","width":196,"height":110},{"url":"https://i.ytimg.com/vi/WpN5PjOxHbo/hqdefault.jpg?sqp=-oaymwEjCPYBEIoBSFryq4qpAxUIARUAAAAAGAElAADIQj0AgKJDeAE=\u0026rs=AOn4CLBLFWPfMOMy5p_uXomcNBJZ_uciBA","width":246,"height":138},{"url":"https://i.ytimg.com/vi/WpN5PjOxHbo/hqdefault.jpg?sqp=-oaymwEjCNACELwBSFryq4qpAxUIARUAAAAAGAElAADIQj0AgKJDeAE=\u0026rs=AOn4CLDU4iUIyL0ytNe57bIgXqvV3ahobA","width":336,"height":188},{"url":"https://i.ytimg.com/vi/WpN5PjOxHbo/maxresdefault.jpg","width":1920,"height":1080}]},"useCipher" so extraordinary. \n\nWhats interesting is that over the past few years, the U.S. Government has become more open to admitting the existence of this UFO stuff. Interesting that the U.S. Government isnt completely ignoring these claims anymore.  Probably because when something odd is seen, it can now be easily recorded since cameras are everywhere, and once its recorded, the internet can spread it across the world in seconds.\n\nWhats interesting about all this is someones lying, its either the U.S. Government for totally hiding and covering all this up or its Bob Lazar. So were going to put our neutral hats on to analyze Bob Lazars body language, piece together his story, and review the evidence to find out if he is truthful or just lying.\n\nNow in the comments, why do you think the U.S. Government seems to be trying to hide all this from us? Let everyone know in the comments below.\n\nGive this video a THUMBS UP if you think were NOT ALONE in the universe.\n\nGive this video a THUMBS DOWN if you think were COMPLETELY ALL ALONE in the universe.\n\nRemember to subscribe so you dont miss out on new body language and investigative videos where we always seem to shake up YouTube, and Ill see you at the top.\n\n#BobLazar #Area51 #BodyLanguage\n\nMy Vlog Channel:\nhttps://www.youtube.com/channel/UCGof-YmYH1e-Hu9tmH39_rw\n\nFollow me and also send me your future video ideas via social media:\nInstagram:\nhttps://www.instagram.com/derekvanschaik\n\nTwitter:\nhttps://www.twitter.com/derekvanschaik\n\nFacebook:\nhttps://www.facebook.com/derekmvanschaik\n\nWebsite:\nhttps://www.derekvanschaik.com"},"lengthSeconds":"3829","ownerProfileUrl":"http://www.youtube.com/channel/UC65EDzqpOAQZLBmAdHAnZng","externalChannelId":"UC65EDzqpOAQZLBmAdHAnZng","isFamilySafe":true,"availableCountries":["AD","AE","AF","AG","AI","AL","AM","AO","AQ","AR","AS","AT","AU","AW","AX","AZ","BA","BB","BD","BE","BF","BG","BH","BI","BJ","BL","BM","BN","BO","BQ","BR","BS","BT","BV","BW","BY","BZ","CA","CC","
